import { Component } from '@angular/core';
import { ConversionApiService } from '../../services/conversion-api.service';
import { FormGroup, FormControl, Validators } from '@angular/forms';

@Component({
  selector: 'app-list',
  templateUrl: './list.component.html',
  styleUrls: ['./list.component.css']
})
export class ListComponent {

  //#region Properties

  frmList!: FormGroup

  //#endregion

  //#region Constructors

  constructor(
    private conversionApiService: ConversionApiService
  ) {

    this.#init()
  }

  get startDate() { return this.frmList.controls['startDate'].value }
  get endDate() { return this.frmList.controls['endDate'].value }

  //#endregion

  //#region Methods

  #init() {

    this.frmList = new FormGroup({
      startDate: new FormControl('', [Validators.required]),
      endDate: new FormControl('', [Validators.required]),
    })
  }

  #search() {

    this.conversionApiService
      .search(this.startDate(), this.endDate())
      .then(val => {
        console.log('val :>> ', val);
      })
      .catch(err => {
        console.log('err :>> ', err);
      })
      .finally(() => {

      })
  }

  //#endregion
}
